import logo from "./logo.svg";
import "./App.css";
import { Contract, networks } from "seven-up-seven-down";

async function App() {
  const tracker = new Contract({
    contractId: networks.futurenet.contractId,
    networkPassphrase: networks.futurenet.networkPassphrase,
    rpcUrl: "https://rpc-futurenet.stellar.org/",
  });
  const answers = await tracker.play({ prediction: "up" });
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          {Array.from(answers.result.keys())}
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
